import React from "react";
import 'bootstrap-4-react';

import './style.css';

export default function SaleForm(){
    document.title = "Private sale";
    return (
        <>
            <form action="">
                <h1>To participate in a private sale, fill out the following form :</h1>
                <input type="text" placeholder="Name or organization"/>
                <label htmlFor="invest">minimum quantity
                <br />$100 000</label>
                <input type="text" id="invest" placeholder="Amount of investment"/>
                <input type="text" placeholder="Email"/>
                <div className="form-container">
                    <button type="submit">Ok</button>
                </div>
            </form>
        </>
    );
}
